function internationalize(e){return e.replace(/__MSG_(\w+)__/g,function(e,n){return"undefined"!==chrome.i18n.getMessage(n)&&""!==chrome.i18n.getMessage(n)?chrome.i18n.getMessage(n):"[Error:"+n+"]"})}function setLocalization(){document.getElementsByTagName("body")[0].innerHTML=internationalize(document.getElementsByTagName("body")[0].innerHTML)}setLocalization();